 Sure, here's the Python code to sort a list by bubble sort:
```python
def bubble_sort(arr):
    n = len(arr)

    for i in range(n):
        swapped = False

        for j in range(0, n-i-1):
            if arr[j] > arr[j+1]:
                arr[j], arr[j+1] = arr[j+1], arr[j]
                swapped = True

        if not swapped:
            break

    return arr
```
This function takes in a list and sorts it using bubble sort algorithm. The list is iterated through twice, in the first pass, a temporary variable `swapped` is used to check whether any swap has occurred or not. If there's a swap, the swap is made, and `swapped` becomes `True`. If no swap occurs, the inner loop terminates. In the second pass, the list is iterated through again, if two or more elements are in the same position in the sorted list, the second pass iterates through that range
